React Universal Rendering
&nbsp;&nbsp;
Docs - Get Started


Features

Universal React:Renders your components on the server-side and continues rendering on the client-side
HTML5 and AMPHTML:Supports normal HTML5 web-applications and mobile-optimised AMPHTML.

Idea
The main idea for TelAviv.js is to render a React app initially on a Node.js server and continue further rendering in the user&#39;s browser. The next route changes will only request data from the API.
Why?
This concept combines the benefits of server rendering and client rendering:

Search Engine optimized:The TelAviv.js server fetches all data from your REST-API before responding. So crawlers are able to index all your pages.
Fast initial load:The TelAviv.js server renders static html markup including the minimal set of css. All JavaScript code gets loaded asynchronous.
Minimal server traffic:After the JavaScript code was loaded, the TelAviv.js script handles all route changes and only loads data from the API, which relieves the server.

Installation
npm install telaviv --save
Usage
Basically TelAviv.js is a express middleware.
import telaviv from &#39;telaviv&#39;
import express from &#39;express&#39;
import config from &#39;config.js&#39;

let app = express()

app.use(telaviv(config))

app.listen(8080)

config.js
export default {
  routes: [{
    path: &#39;/article/:id&#39;,
    html5: [{
      component: &#39;Header&#39;
    }, {
      component: &#39;Article&#39;,
      data: {
        type: &#39;REST&#39;,
        url: &#39;/api/article/:id&#39;
      }
    }, {
      component: &#39;Footer&#39;
    }]
  }],
  apiAddress: &#39;http://localhost:8000/&#39;
}

